(2, '359-K2363', 'Товар 14', '7.56', 1, 9, 9, 6, 7, 2, 3, 'L', 'Esse rem et ratione deleniti necessitatibus et non minus. Ipsum nemo delectus nesciunt id ut non. Voluptatem qui blanditiis id ipsum adipisci. Aut odio ut est occaecati. Ab voluptatibus quas quis voluptatem iusto. Dolores labore odit esse quo. Provident sunt quaerat est ut voluptatem doloribus. Deleniti aspernatur sapiente dignissimos est eligendi quod. Voluptates impedit enim inventore ex dolor. Quisquam unde non necessitatibus excepturi ea in ipsum.', 0, 0, '2019-05-11 11:59:43', '2019-05-11 11:59:43', 'https://lorempixel.com/200/200/?11230', 'https://lorempixel.com/1920/1080/?99360'),
(3, '054-M5212', 'Товар 25', '4.46', 0, 4, 4, 4, 10, 3, 1, 'XS', 'Culpa delectus beatae facilis voluptatem soluta. Aut quis vel quasi voluptatem dolorum. Voluptate exercitationem eos delectus sint delectus. Blanditiis et inventore voluptas harum aut temporibus. Explicabo est aut tenetur ab ipsam maiores. Error maiores debitis explicabo harum rem harum eveniet. In occaecati molestias qui adipisci nesciunt in sed.', 0, 0, '2019-05-11 11:59:43', '2019-05-11 11:59:43', 'https://lorempixel.com/200/200/?85652', 'https://lorempixel.com/1920/1080/?24893'),
